<style type="text/css">

	/* Base style */

	*{
		position: absolute;
	}

	svg * {
		margin: 0px;
		fill: black;
		stroke: black;
		stroke-width: 10px;
		stroke-miterlimit: 100;
	}

	.svgnofill {
		fill-opacity: 1;
		animation-timing-function: ease-out;
		animation-fill-mode: forwards;
		animation-iteration-count: 1;

		animation-name: FillOut;
		animation-duration: 2s;		
	}

	.svgfill {
	  	fill-opacity: 0;
		animation-timing-function: ease-in;
		animation-fill-mode: forwards;
		animation-iteration-count: 1;

		animation-name: FillIn;
		animation-duration: 22s;
		animation-delay: 7s;
	}

	@keyframes FillOut {
		from { fill-opacity: 1; }
		to { fill-opacity: 0; }
	}

	@keyframes FillIn {
		from { fill-opacity: 0; }
		to { fill-opacity: 1; }
	}

</style>
